create table category (
	category_id INT PRIMARY KEY,
	name VARCHAR(50),
	count INT
);

create table role (
	role_id INT PRIMARY KEY,
	name VARCHAR(50)
);

create table post (
	post_id INT PRIMARY KEY,
	title VARCHAR(50),
	price double precision,
	deposit double precision,
	address VARCHAR(50),
	phone VARCHAR(50),
	content TEXT,
	status BOOLEAN,
	longitude VARCHAR(50),
	latitude VARCHAR(50),
	created_at DATE,
	wardid VARCHAR(5),
	category_id INT,
	user_id INT
);




create table service (
	service_id INT PRIMARY KEY,
	name VARCHAR(50)
);

create table post_service (
	post_id INT,
	service_id INT
);


create table fys_user (
	user_id INT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	password VARCHAR(50),
	address VARCHAR(50),
	phone VARCHAR(50),
	avatar VARCHAR(100),
	status BOOLEAN,
	registered DATE,
	role_id INT
);


create table picture (
	picture_id INT PRIMARY KEY,
	url VARCHAR(100),
	post_id INT
);


create table payment (
	payment_id INT PRIMARY KEY,
	name VARCHAR(50)
);


create table fys_order (
	order_id INT PRIMARY KEY,
	amount double precision,
	status BOOLEAN,
	created_at DATE,
	payment_id INT,
	post_id INT,
	user_id INT
);

create table request (
	id INT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	phone VARCHAR(50),
	address VARCHAR(50),
	content TEXT,
	create_at DATE,
	user_id INT,
	category_id INT,
	wardid varchar(5)
);


